import React from "react";

class AuthorizationToggle extends React.Component {
    render() {
        return (
            <div className='authorization__toggle'>
                <Link to='/login/authorization' className={this.props.currentLocation === 'authorization' ? 'active' : ''}>Вход</Link>
                <Link to='/login/registration' className={this.props.currentLocation === 'registration' ? 'active' : ''}>Регистрация</Link>
            </div>
        )
    }
}

export default AuthorizationToggle;
